var font = "";
export function registerLiberationSansBaDnNormal(jsPDFAPI) {
    var callAddFont = function () {
        this.addFileToVFS("LiberationSans-BaDn-normal.ttf", font); // 'font' variable is now accessible
        this.addFont("LiberationSans-BaDn-normal.ttf", "LiberationSans-BaDn", "normal");
    };
    jsPDFAPI.events.push(['addFonts', callAddFont]);
}